import React, {useEffect, useState} from "react";
import {useTable} from "react-table";

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const placeholderMatches = [
      {
        match_id: "Match 1",
        player_A: "Player A",
        player_B: "Player B",
        tourney_name: "Tournament 1",
        tourney_level: "Level 1",
        surface: "Grass",
        round: "Final",
        A_elo: 2000,
        B_elo: 1800,
      },
      // Add more placeholder matches as needed
    ];

    const delay = setTimeout(() => {
      setData(placeholderMatches);
    }, 1000);

    return () => clearTimeout(delay);
  }, []);

  const columns = React.useMemo(
    () => [
      {
        Header: "Match ID",
        accessor: "match_id",
      },
      {
        Header: "Player A",
        accessor: "player_A",
      },
      {
        Header: "Player B",
        accessor: "player_B",
      },
      {
        Header: "Tourney Name",
        accessor: "tourney_name",
      },
      {
        Header: "Tourney Level",
        accessor: "tourney_level",
      },
      {
        Header: "Surface",
        accessor: "surface",
      },
      {
        Header: "Round",
        accessor: "round",
      },
      {
        Header: "A Elo",
        accessor: "A_elo",
      },
      {
        Header: "B Elo",
        accessor: "B_elo",
      },
    ],
    []
  );

  const {getTableProps, getTableBodyProps, headerGroups, rows, prepareRow} = useTable({columns, data});

  return (
    <table {...getTableProps()} style={{width: "100%"}}>
      <thead>
        {headerGroups.map((headerGroup) => (
          <tr {...headerGroup.getHeaderGroupProps()}>
            {headerGroup.headers.map((column) => (
              <th {...column.getHeaderProps()}>{column.render("Header")}</th>
            ))}
          </tr>
        ))}
      </thead>
      <tbody {...getTableBodyProps()}>
        {rows.map((row, i) => {
          prepareRow(row);
          return (
            <tr {...row.getRowProps()}>
              {row.cells.map((cell) => {
                return <td {...cell.getCellProps()}>{cell.render("Cell")}</td>;
              })}
            </tr>
          );
        })}
      </tbody>
    </table>
  );
}

export default App;
